// applying UI theme settings for main window
function getYellowTheme2(){
    var theme_yellow2 = {
        "icon_description" : "data:image/png;base64,",
        "icon_description_1" : "data:image/png;base64,",
        "icon_settings" : "data:image/png;base64,",
        "icon_settings_1" : "data:image/png;base64,",
        "icon_shortcuts" : "data:image/png;base64,",
        "icon_shortcuts_1" : "data:image/png;base64,",
        "icon_authors" : "data:image/png;base64,",
        "icon_authors_1" : "data:image/png;base64,"

    };

    //console.log('theme_yellow - ' , theme_yellow);
    return theme_yellow2;
}

$( document ).ready(function() {
    var theme_yellow2 = getYellowTheme2();

    //search vindow
    $('.ewq532_fast-search-button.ewq532_fast-search-button1 img').attr('src',theme_yellow2['icon_description']);
    $('body').append('<input id="ewq532_fast-search-button_description" changed="0" type="hidden" value="'+theme_yellow2["icon_description_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button2 img').attr('src',theme_yellow2['icon_settings']);
    $('body').append('<input id="ewq532_fast-search-button_settings" changed="0" type="hidden" value="'+theme_yellow2["icon_settings_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button3 img').attr('src',theme_yellow2['icon_shortcuts']);
    $('body').append('<input id="ewq532_fast-search-button_shortcuts" changed="0" type="hidden" value="'+theme_yellow2["icon_shortcuts_1"]+'" />');
    $('.ewq532_fast-search-button.ewq532_fast-search-button4 img').attr('src',theme_yellow2['icon_authors']);
    $('body').append('<input id="ewq532_fast-search-button_authors" changed="0" type="hidden" value="'+theme_yellow2["icon_authors_1"]+'" />');
    $('.full_ewq532_fast-search div.ewq532_fast-search,section.ewq532_fast-search').css('border-color','#FFE870');
    $('.big_ewq532_fast-search').css('border-color','#FFE870');
    $('.full_ewq532_fast-search .big_ewq532_fast-search.ewq532_fast-search').css('background','white');
    $('.fast_search_menu_ewq532_fast-search.ewq532_fast-search').css('background','white');


});
